    if (((R ^ IS_R_INVERTED_REG) && (R !== 1'bz)) || (R === 1'bx && Q == 1'b0))
      Q <=  1'b0;
    else if (CE || (CE === 1'bz) || ((CE === 1'bx) && (Q == (D ^ IS_D_INVERTED_REG))))
